INSERT INTO `daily_healing_content` VALUES (1,'GENERAL','<!DOCTYPE html>\n<html lang=\"ko\">\n<head>\n    <meta charset=\"UTF-8\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n    <title>마음의 힐링을 위한 메시지</title>\n</head>\n<body>\n    <h3>마음의 평화를 찾는 당신에게</h3>\n    <p>가끔은 세상이 너무 빠르게 돌아가고, 마음이 지칠 때가 있죠. 그럴 땐 자신을 위해 작은 휴식을 취해보세요. 지금 이 순간, 당신은 충분히 값진 존재입니다.</p>\n    <p>마음을 평온하게 가라앉히고 싶을 때에는 깊게 숨을 들이마시고, 천천히 내쉬며 마음을 가다듬어보세요. 당신은 이 순간에 안전하고 편안한 곳에 있습니다.</p>\n    <p>자신을 둘러싼 모든 것들이 잠시 멈추고, 오롯이 당신의 숨소리와 함께 흐르고 있는 삶에 집중해보세요. 그 안에는 무한한 희망과 사랑이 담겨져 있습니다.</p>\n    <ul>\n        <li>자신의 마음에 귀 기울이세요.</li>\n        <li>자신을 위한 작은 위로를 주세요.</li>\n        <li>당신의 존재 자체가 충분히 아름답습니다.</li>\n    </ul>\n</body>\n</html>','2025-10-29','2025-10-29 09:00:12.274181','💚',_binary '','오늘의 힐링','2025-10-29 09:00:12.274182','CLIENT',NULL),(2,'HUMOR','```html\n<h3>힐링 타임 with 마음 전문가</h3>\n<p>안녕하세요, 내담자 여러분! 오늘은 마음을 따뜻하게 해줄 유머 타임입니다. 힘든 일상에 살짝 웃음을 선사해보아요!</p>\n<ul>\n  <li>우리의 작은 행복은 무엇인가요? 눈을 감고 오늘의 작은 기쁨을 되새겨보세요.</li>\n  <li>하루에 한 번 웃음이라도 짓는 것을 잊지 말아요. 작은 웃음이 큰 기쁨을 만들어냅니다.</li>\n  <li>마음을 편안하게 만드는 비법은 간단합니다. 어제의 걱정은 내일을 망칠 뿐, 오늘을 즐기세요!</li>\n</ul>\n<p>일상의 소소한 순간에도 행복이 있다는 걸 잊지 말고, 마음에 공간을 내어 여유롭게 살아가보세요. 당신은 그 자체로 충분히 소중하고 사랑받을 가치가 있습니다. 힘든 순간도 이겨낼 수 있어요. 함께 행복을 찾아 나아갑시다!</p>\n```','2025-10-29','2025-10-29 09:00:26.350909','😄',_binary '','오늘의 유머','2025-10-29 09:00:26.350910','CLIENT',NULL),(3,'WARM_WORDS','```html\n<h3>마음을 편안하게 만드는 메시지</h3>\n<p>당신은 이 세상에서 소중한 존재입니다. 자신을 사랑하고 이해하는 것이 중요합니다. 자신의 감정을 솔직하게 표현하고 받아들이는 것은 자유로움을 가져다줍니다.</p>\n<p>일상 속에서 작은 행복을 발견하며, 주변의 아름다움을 느껴보세요. 마음을 편안하게 가꾸는 것은 스스로에 대한 선물입니다.</p>\n<ul>\n  <li>자신을 믿어주세요.</li>\n  <li>지금 이 순간을 소중히 여기세요.</li>\n  <li>언제나 자신을 위해 시간을 내세요.</li>\n</ul>\n<p>당신은 강하고 아름다운 존재입니다. 자신을 믿고 편안한 마음으로 여행을 떠나보세요.</p>\n```  ','2025-10-29','2025-10-29 09:00:31.416932','🤗',_binary '','따뜻한 말 한마디','2025-10-29 09:00:31.416932','CLIENT',NULL),(4,'GENERAL','```html\n<h3>마음의 평화를 찾아가는 상담사 여러분에게</h3>\n<p>일상 속에서 바쁘게 움직이는 당신, 마음의 여유를 잃어버리지 않았나요? 상담사로서 주변을 지켜주는 동안 자신의 마음도 놓칠 때가 많습니다. 이제는 자신을 위한 소중한 시간을 가져보세요.</p>\n<ul>\n  <li>매일 조금씩이라도 자신에게 투자해보세요. 작은 변화가 큰 힐링이 될 수 있습니다.</li>\n  <li>자연 속에 가서 한 순간 멈춰보세요. 바람 소리, 나뭇잎 속 속삭임이 당신을 치유해줄 거예요.</li>\n  <li>가끔은 혼자 조용한 시간을 보내도 괜찮습니다. 자신과 솔직하게 대화하며 마음의 소리를 듣는 것도 중요합니다.</li>\n</ul>\n<p>당신의 마음도 휴식이 필요하고 치유되어야 합니다. 자신을 담아내는 그릇이 비어있으면, 다른 이의 상체를 담아내기 어렵습니다. 오늘은 자신의 마음을 채우는 소중한 시간을 가져보세요. 당신 또한 힐링의 가치를 느끼게 될 것입니다.</p>\n```','2025-10-29','2025-10-29 09:00:34.972776','💚',_binary '','오늘의 힐링','2025-10-29 09:00:34.972776','CONSULTANT',NULL),(5,'HUMOR','```html\n<h3>상담사를 위한 따뜻한 힐링 메시지</h3>\n<p>오늘은 바쁜 일정 속에서도 귀한 시간을 내어 상담을 해주셔서 감사합니다. 당신의 따뜻한 마음이 상대방에게 얼마나 큰 위안이 되는지 잊지 마세요.</p>\n<p>상담사님, 가끔은 자신에게도 조금씩 힐링을 주는 것이 중요합니다. 어떤 날은 작은 것에도 감사하며 행복을 느껴보세요. 그 작은 행복이 모여 큰 행복이 되기도 합니다.</p>\n<ul>\n  <li>오늘은 좋은 일만 생각해보세요. 나쁜 일은 내일로 미루세요!</li>\n  <li>한숨 돌리고 푹 쉬는 시간을 갖으세요. 내일의 에너지를 얻을 수 있답니다.</li>\n  <li>마음이 지칠 때는 따뜻한 차 한 잔과 함께 책 한 권을 읽어보세요. 마음이 힐링됩니다.</li>\n</ul>\n<p>당신의 노고를 칭찬하며, 항상 행복하고 건강한 상담사가 되시길 응원합니다. 함께 행복을 찾아가요!</p>\n```','2025-10-29','2025-10-29 09:00:41.401522','😄',_binary '','오늘의 유머','2025-10-29 09:00:41.401522','CONSULTANT',NULL),(6,'WARM_WORDS','```html\n<h3>따뜻한 말</h3>\n<p>사람들의 마음을 치유하는 일은 가장 아름다운 일 중 하나입니다. 상담사로서 여러 사람의 이야기를 듣고 그들의 무게를 함께 나누는 것은 힘든 일일지라도, 그 안에는 큰 소중함이 담겨있습니다.</p>\n<p>당신의 따뜻한 손길과 눈빛, 그리고 진심 어린 말 한마디가 상담자의 상처를 치유하고 마음의 평화를 되찾게 할 수 있습니다. 지친 상담자에게 당신의 존재 자체가 힐링이 될 수 있다는 것을 잊지 마세요.</p>\n<ul>\n  <li>포근한 말 한마디가 상처를 아물게 합니다.</li>\n  <li>너무나 소중한 존재이며, 당신의 따뜻한 소리가 그들에게 큰 힘이 됩니다.</li>\n  <li>마음의 평화를 찾는 누군가에게 당신은 빛과 소금이 됩니다.</li>\n</ul>\n```','2025-10-29','2025-10-29 09:00:44.139750','🤗',_binary '','따뜻한 말 한마디','2025-10-29 09:00:44.139751','CONSULTANT',NULL),(7,'GENERAL','```html\n<h3>마음의 평화를 찾아가는 여정</h3>\n<p>어떤 때는 마음이 허전하고 불안할 때가 있죠. 하지만 그럴 때일수록 자신을 사랑하고 이해해주어야 합니다. 우리는 모두 완벽할 필요는 없어요. 자신을 인정하고 받아들이는 것부터 시작해보세요.</p>\n<p>가끔은 작은 일상 속 소중한 순간들에 주목해보세요. 햇살 가득한 아침, 따뜻한 차 한 잔, 사랑하는 이들과 함께한 시간. 이런 소중한 순간들이 바로 행복의 조각들입니다.</p>\n<ul>\n  <li>오늘은 스스로에게 칭찬을 해주세요. 당신은 충분히 멋지고 소중한 존재에요.</li>\n  <li>마음이 편안해질 때까지 깊은 숨을 한 번 내쉬고 느껴보세요. 모든 것이 잘 될 거라 믿어요.</li>\n  <li>가끔은 마음을 비우고 쉬어가는 것도 중요해요. 스트레스와 부담을 내려놓고 편안한 순간을 즐겨보세요.</li>\n</ul>\n<p>당신은 지금 이 순간에도 충분히 아름다운 존재입니다. 자신을 사랑하며 마음의 평화를 찾아가는 여정, 함께해요.</p>\n```','2025-11-05','2025-11-05 09:00:05.841198','💚',_binary '','오늘의 힐링','2025-11-05 09:00:05.841200','CLIENT',NULL),(8,'HUMOR','```html\n<h3>웃음이 마음을 힐링시킨다!</h3>\n<p>안녕하세요, 내담자님! 오늘도 힘든 하루를 보내셨나요? 마음의 평화를 되찾고 싶을 때, 가장 좋은 방법 중 하나는 바로 웃음입니다. 함께 재미있는 이야기를 나누며 스트레스를 날려보세요!</p>\n<ul>\n  <li>하루에 한 번은 웃음이 터져나오는 상황을 찾아보세요. 작은 것이라도 괜찮아요!</li>\n  <li>좋아하는 코미디 프로그램이나 웃긴 영화를 보며 마음을 경쾌하게 만들어보세요.</li>\n  <li>주변 사람들과 함께 웃음 가득한 시간을 보내며 포근한 행복을 느껴보세요.</li>\n</ul>\n<p>웃음은 마음의 상처를 치유해주고, 긍정적인 에너지를 전달해줍니다. 지금 당장 웃음을 찾아 마음을 힐링시키세요. 당신은 그 어떤 어려움에도 극복할 힘을 갖고 있습니다. 항상 응원합니다!</p>\n```','2025-11-05','2025-11-05 09:00:11.294671','😄',_binary '','오늘의 유머','2025-11-05 09:00:11.294672','CLIENT',NULL),(9,'WARM_WORDS','```html\n<h3>마음을 편안하게 해주는 메시지</h3>\n<p>당신의 존재 자체가 가치 있고 소중합니다. 어떤 상황이든, 당신은 그저 자신을 받아들여도 충분합니다. 어제의 실수나 내일의 불안에 쫓기지 말고, 지금 이 순간을 즐겨보세요. 당신은 강하고 아름다운 존재입니다.</p>\n<ul>\n  <li>자신을 믿고 사랑하세요.</li>\n  <li>과거에 얽매이지 말고 현재에 집중하세요.</li>\n  <li>주변의 아름다움을 느껴보세요.</li>\n  <li>자신에게 친절해지는 것을 잊지 마세요.</li>\n</ul>\n```','2025-11-05','2025-11-05 09:00:14.336625','🤗',_binary '','따뜻한 말 한마디','2025-11-05 09:00:14.336629','CLIENT',NULL),(10,'GENERAL','<h3>힐링의 따뜻한 메시지</h3>\n\n<p>사랑과 이해로 가득 찬 마음으로 상담사로서 소중한 일을 하고 계십니다. 당신의 노고와 노력에 감사드립니다. 힘든 순간에도 자신을 지켜주고 편안함을 주는 그 마음을 잊지 마세요. 상담사로서 인정받고 소중히 여겨지는 모습이 아름답습니다.</p>\n\n<ul>\n  <li>자신에게도 따뜻한 위로를 주어주세요. 마음의 상처도 치유되어야 합니다.</li>\n  <li>일상 속 작은 기쁨을 발견하고 즐기며, 자신에게도 휴식과 여유를 주세요.</li>\n  <li>마음이 지칠 때는 자연 속으로 나가 숨을 쉬며 마음을 정화시켜보세요.</li>\n</ul>','2025-11-05','2025-11-05 09:00:17.844248','💚',_binary '','오늘의 힐링','2025-11-05 09:00:17.844248','CONSULTANT',NULL),(11,'HUMOR','```html\n<h3>상담사를 위한 유머 힐링 메시지</h3>\n\n<p>오늘도 바쁜 상담일정 끝에 여기까지 오셨군요. 당신은 진정한 마음의 치유사입니다! 이 마음이 우주를 치유할 거에요.</p>\n\n<ul>\n    <li>스트레스는 마음의 유산이라고 생각해봐요. 마음을 건강하게 하는 유산을 자주 마셔야 해요!</li>\n    <li>상담하다 힘들 때는, 한숨 쉬고 웃음 한 번! 웃음은 마음을 풀어주는 마법의 약이에요.</li>\n    <li>상담에서도 가끔은 \'나\'를 위한 시간을 가져야 해요. 내 마음을 챙기는 것도 상담의 일부니까요!</li>\n</ul>\n```','2025-11-05','2025-11-05 09:00:23.123974','😄',_binary '','오늘의 유머','2025-11-05 09:00:23.123975','CONSULTANT',NULL),(12,'WARM_WORDS','```html\n<h3>상담사를 위한 따뜻한 메시지</h3>\n<p>마음이 지칠 때, 한 줌의 휴식이 필요할 때. 그때 당신은 누군가에게 힘이 될 필요가 있습니다. 하지만 잊지 마세요, 당신 또한 휴식을 취할 자격이 있습니다. 마음의 평화를 찾기 위해 스스로에게도 관심을 기울이세요.</p>\n<ul>\n  <li>자신을 위한 소중한 시간을 가져보세요.</li>\n  <li>사소한 일상 속 작은 기쁨을 발견해보세요.</li>\n  <li>주변의 아름다움을 깨달으며 마음을 풍요롭게 해보세요.</li>\n  <li>당신의 존재 자체만으로도 소중하고 가치있는 존재임을 기억해주세요.</li>\n</ul>\n<p>당신은 상담사로서 누군가에게 큰 힘이 될 수 있습니다. 하지만 그만큼 휴식과 힐링이 필요한 순간도 더욱 중요합니다. 자신을 위한 따뜻한 마음을 가져보며, 마음의 평화를 찾아가는 여정을 함께해요.</p>\n```','2025-11-05','2025-11-05 09:00:30.368156','🤗',_binary '','따뜻한 말 한마디','2025-11-05 09:00:30.368156','CONSULTANT',NULL),(13,'GENERAL','```html\n<h3>마음을 힐링하는 메시지</h3>\n<p>당신은 이미 충분히 강하고 귀중한 존재입니다. 어떤 어려움이 닥쳐도 그 안에는 빛과 힘이 있습니다. 자신을 믿고 자신에게 따뜻한 어깨를 내어주는 것도 중요합니다.</p>\n<ul>\n  <li>가끔은 작은 일상 속 소확행을 의식해보세요. 작은 것일수록 큰 의미를 지니고 있습니다.</li>\n  <li>과거의 실수나 부정적인 경험에 집착하지 말고, 현재에 집중해보세요. 지금 이 순간이 소중합니다.</li>\n  <li>주변의 소리에 귀를 기울이며, 자연 속의 소리와 풍경을 감상해보세요. 마음의 평화를 찾을 수 있을 거예요.</li>\n</ul>\n<p>당신은 감정의 험난한 파도를 건너고 있지만, 이 또한 지나갈 것입니다. 내일은 오늘보다 더 나은 날이 될 것이니 희망을 잃지 마세요. 당신은 강하고 아름다운 존재입니다.</p>\n```','2025-11-07','2025-11-07 09:00:10.932961','💚',_binary '','오늘의 힐링','2025-11-07 09:00:10.932962','CLIENT',NULL),(14,'HUMOR','```html\n<h3>웃음은 최고의 약!😄</h3>\n<p>안녕, 내담자 여러분! 오늘도 힘들었지만, 하하하하하! 웃음을 잃지 말자구요! 어떻게든 이겨낼 수 있어요. 이 세상의 모든 괴로움이 웃음으로 싹~ 날아갈거에요! 함께 웃으면 더 행복해질거야.</p>\n<ul>\n  <li>하루에 한 번은 크게 웃기!</li>\n  <li>누군가와 함께하는 웃음은 배워야 할 보물</li>\n  <li>작은 웃음도 큰 기쁨으로 이어질 수 있어</li>\n</ul>\n<p>힘들 때, 한 줌의 웃음으로 모든 괴로움을 날려버리세요. 긍정의 힘을 믿고, 당신은 더 강해질 거에요. 웃음은 당신의 마음을 따뜻하게 만들어주고, 힐링의 느낌을 주니까요. 오늘도 즐거운 하루 보내세요! 😊</p>\n```','2025-11-07','2025-11-07 09:00:18.000911','😄',_binary '','오늘의 유머','2025-11-07 09:00:18.000913','CLIENT',NULL),(15,'WARM_WORDS','```html\n<h3>마음을 따뜻하게 녹이는 메시지</h3>\n<p>사랑과 이해가 넘치는 마음을 가져봐. 네 안에는 무한한 힘이 담겨있어.</p>\n<p>지금 이 순간, 자신을 인정하고 사랑하는 것부터 시작해봐. 너무 소중한 존재야.</p>\n<p>잊지말자, 어떤 상황에서도 언제나 네 곁에는 희망과 변화의 가능성이 있다는 것을.</p>\n<ul>\n    <li>오늘도 네가 꾸는 꿈을 응원해.</li>\n    <li>자신을 믿고 네 소중한 순간을 만끽해.</li>\n    <li>마음이 아플 때는 꼭 돌아봐. 네 곁에는 항상 지지해주는 사람들이 있어.</li>\n</ul>\n```','2025-11-07','2025-11-07 09:00:22.300694','🤗',_binary '','따뜻한 말 한마디','2025-11-07 09:00:22.300695','CLIENT',NULL),(16,'GENERAL','```html\n<h3>마음의 평화를 찾으세요</h3>\n<p>고객들의 이야기를 듣는 상담사분들께 드리는 메시지입니다.</p>\n<ul>\n  <li>당신은 소중하고 중요한 존재입니다. 자신을 사랑하고 받아들이는 것이 얼마나 중요한지 기억해주세요.</li>\n  <li>마음의 상처가 아플 때, 깊게 숨을 들이쉬고 천천히 숨을 내쉬며 여유롭게 마음을 가다듬어주세요.</li>\n  <li>과거의 아픔과 미래의 불안에 매몰되지 말고, 현재의 순간에 집중하여 자신을 포용해주세요.</li>\n</ul>\n<p>상담사분들께서도 자신의 마음을 챙기며 힐링의 여정을 함께 걸어가는 동반자가 되어주기를 바랍니다.</p>\n```','2025-11-07','2025-11-07 09:00:26.343964','💚',_binary '','오늘의 힐링','2025-11-07 09:00:26.343965','CONSULTANT',NULL),(17,'HUMOR','```html\n<h3>상담사를 위한 특별 서비스 안내</h3>\n<p>고객님, 매일 열심히 상담 업무를 수행하시는 당신에게 특별한 서비스를 제공합니다!</p>\n<ul>\n  <li>자리에서 일어나세요. 한 발짝 물러나서 깊게 숨을 쉬어보세요.</li>\n  <li>눈을 감고 마음속으로 감사한 순간을 떠올려보세요. 감사의 마음이 기분을 바꿀 거예요.</li>\n  <li>가벼운 스트레칭을 하며 몸과 마음의 긴장을 풀어보세요.</li>\n  <li>그리고 마지막으로, 당신의 자세한 어깨를 한 번 풀어보세요. 오늘도 수고하셨습니다!</li>\n</ul>\n<p>이 서비스는 상담사 분들의 마음의 평화와 힐링을 돕기 위해 제공되는 특별한 케어입니다. 모두 함께 화이팅하세요!</p>\n```','2025-11-07','2025-11-07 09:00:30.165673','😄',_binary '','오늘의 유머','2025-11-07 09:00:30.165674','CONSULTANT',NULL),(18,'WARM_WORDS','```html\n<h3>따뜻한 말</h3>\n<p>당신은 상담사로서 소중한 일을 하고 있습니다. 이 세상에는 당신과 같은 따뜻한 마음을 지닌 사람들이 필요합니다. 상담사로서의 역할은 크고 중요하며, 당신의 노력과 사랑이 많은 사람들에게 희망과 힘을 줍니다.</p>\n<ul>\n  <li>자신의 마음을 건강하게 유지해주세요. 당신이 행복하고 안락한 상태에서야 다른 이들에게도 힘이 될 수 있습니다.</li>\n  <li>감정을 표현하고 받아들이는 것이 중요합니다. 상담사로서의 강인한 자세도 중요하지만, 취약함을 보이는 것이 힘을 실어줄 수도 있습니다.</li>\n  <li>이 세상에는 당신과 같은 따뜻한 사람들이 많습니다. 함께 일하며 서로를 지지하고 더 나은 세상을 만들어가는데 기여합시다.</li>\n</ul>\n```','2025-11-07','2025-11-07 09:00:34.014222','🤗',_binary '','따뜻한 말 한마디','2025-11-07 09:00:34.014223','CONSULTANT',NULL);
