INSERT INTO `daily_humor` VALUES (1,'WORK','CONSULTANT','상담사: \"오늘은 어떤 기분이세요?\"\n내담자: \"좋지 않아요...\"\n상담사: \"그럼 좋지 않은 기분을 자세히 말씀해주세요.\"\n내담자: \"상담사님이 너무 예뻐서 집중이 안 돼요.\"\n상담사: \"...그럼 오늘은 여기까지 하겠습니다.\"',NULL,NULL,NULL),(2,'WORK','CONSULTANT','상담사가 가장 많이 듣는 말 TOP 3:\n1. \"상담사님은 항상 차분하시네요.\"\n2. \"상담사님은 이해심이 많으시네요.\"\n3. \"상담사님은 진짜 상담사 맞나요?\"',NULL,NULL,NULL),(3,'WORK','CONSULTANT','상담사: \"우울할 때는 밝은 곳에 나가보세요.\"\n내담자: \"상담사님 얼굴만 봐도 충분히 밝아져요!\"\n상담사: \"그럼 제가 조명을 끄고 상담하겠습니다.\"',NULL,NULL,NULL),(4,'LIFE','CONSULTANT','상담사 생활의 현실:\n- 아침: \"오늘은 힘든 내담자 없이 평화로운 하루가 되길...\"\n- 오후: \"아, 오늘도 힘든 하루구나...\"\n- 저녁: \"내일은 더 좋은 하루가 될 거야...\"',NULL,NULL,NULL),(5,'LIFE','CONSULTANT','상담사가 가장 두려워하는 것:\n1. \"상담사님도 힘드시죠?\"\n2. \"상담사님은 상담받으시나요?\"\n3. \"상담사님은 완벽하시네요.\"',NULL,NULL,NULL),(6,'WORK','CLIENT','내담자가 가장 많이 하는 말 TOP 3:\n1. \"상담사님은 이해하실 것 같아요.\"\n2. \"이런 말씀 드려도 될까요?\"\n3. \"상담사님은 정말 신기해요.\"',NULL,NULL,NULL),(7,'WORK','CLIENT','상담 첫날 내담자: \"상담사님은 정말 신기해요.\"\n상담사: \"어떤 점이 신기하신가요?\"\n내담자: \"제 마음을 다 알고 계시네요!\"\n상담사: \"저는 그냥 듣고 있을 뿐인데요...\"',NULL,NULL,NULL),(8,'LIFE','CLIENT','내담자: \"상담을 받으니까 마음이 편해져요.\"\n상담사: \"그렇다니 다행이에요.\"\n내담자: \"그런데 집에 가면 또 힘들어져요.\"\n상담사: \"그럴 때마다 생각해보세요...\"\n내담자: \"생각하면 더 힘들어져요.\"',NULL,NULL,NULL),(9,'LIFE','CLIENT','상담 받는 내담자의 마음:\n- 상담실 입장 전: \"오늘은 진짜 열심히 해야지!\"\n- 상담 중: \"아, 또 울고 말았네...\"\n- 상담 후: \"역시 상담은 힘들어...\"',NULL,NULL,NULL),(10,'LIFE','CLIENT','내담자가 가장 두려워하는 것:\n1. \"상담사님이 실망하실까봐...\"\n2. \"내 문제가 너무 사소할까봐...\"\n3. \"상담사님도 힘드실까봐...\"',NULL,NULL,NULL),(11,'WORK','CONSULTANT','상담사: \"오늘은 어떤 기분이세요?\"\n내담자: \"좋지 않아요...\"\n상담사: \"그럼 좋지 않은 기분을 자세히 말씀해주세요.\"\n내담자: \"상담사님이 너무 예뻐서 집중이 안 돼요.\"\n상담사: \"...그럼 오늘은 여기까지 하겠습니다.\"','2025-09-14 21:55:17.000000',_binary '','2025-09-14 21:55:17.000000'),(12,'WORK','CONSULTANT','상담사가 가장 많이 듣는 말 TOP 3:\n1. \"상담사님은 항상 차분하시네요.\"\n2. \"상담사님은 이해심이 많으시네요.\"\n3. \"상담사님은 진짜 상담사 맞나요?\"','2025-09-14 21:55:17.000000',_binary '','2025-09-14 21:55:17.000000'),(13,'WORK','CONSULTANT','상담사: \"우울할 때는 밝은 곳에 나가보세요.\"\n내담자: \"상담사님 얼굴만 봐도 충분히 밝