INSERT INTO `warm_words` VALUES (1,'APPRECIATION','CONSULTANT','오늘도 힘든 마음들을 들어주느라 고생하셨어요. 당신의 따뜻한 마음이 많은 사람들에게 힘이 되고 있어요.',NULL,NULL,NULL,NULL),(2,'ENCOURAGEMENT','CONSULTANT','상담사님의 작은 한마디가 누군가에게는 큰 위로가 됩니다. 오늘도 소중한 일을 하고 계세요.',NULL,NULL,NULL,NULL),(3,'SUPPORT','CONSULTANT','힘든 상담이 있어도 포기하지 않는 당신의 모습이 정말 아름다워요. 당신은 훌륭한 상담사입니다.',NULL,NULL,'STRESSED',NULL),(4,'APPRECIATION','CONSULTANT','오늘 하루도 열심히 일한 당신에게 박수를 보냅니다. 당신의 노력이 세상을 더 따뜻하게 만들어요.',NULL,NULL,'TIRED',NULL),(5,'SUPPORT','CONSULTANT','상담사님 덕분에 많은 사람들이 희망을 찾고 있어요. 당신은 정말 소중한 존재입니다.',NULL,NULL,'OVERWHELMED',NULL),(6,'APPRECIATION','CONSULTANT','오늘도 따뜻한 마음으로 내담자들을 도와주셔서 감사해요. 당신의 선한 마음이 세상을 밝게 해요.',NULL,NULL,'SUCCESS',NULL),(7,'ENCOURAGEMENT','CONSULTANT','힘든 하루였을 수도 있지만, 당신이 한 번의 상담으로도 누군가의 인생을 바꿀 수 있어요.',NULL,NULL,'STRESSED',NULL),(8,'SUPPORT','CONSULTANT','상담사님의 인내심과 이해심이 많은 사람들에게 희망을 주고 있어요. 당신은 정말 대단해요.',NULL,NULL,'TIRED',NULL),(9,'APPRECIATION','CONSULTANT','오늘도 마음의 상처를 치유하는 소중한 일을 하고 계시는군요. 당신의 따뜻함에 감사합니다.',NULL,NULL,NULL,NULL),(10,'ENCOURAGEMENT','CONSULTANT','힘든 순간에도 포기하지 않는 당신의 모습이 정말 아름다워요. 당신은 훌륭한 상담사입니다.',NULL,NULL,'OVERWHELMED',NULL),(11,'APPRECIATION','ADMIN','관리자로서 시스템을 잘 운영하고 계시는군요. 당신의 노고 덕분에 상담사들이 더 좋은 환경에서 일할 수 있어요.',NULL,NULL,NULL,NULL),(12,'ENCOURAGEMENT','ADMIN','복잡한 관리 업무를 차근차근 처리하시는 모습이 정말 대단해요. 당신의 세심함이 팀 전체의 힘이 됩니다.',NULL,NULL,'STRESSED',NULL),(13,'SUPPORT','ADMIN','관리자님 덕분에 시스템이 안정적으로 운영되고 있어요. 당신의 전문성이 팀의 든든한 버팀목입니다.',NULL,NULL,'TIRED',NULL),(14,'APPRECIATION','BRANCH_SUPER_ADMIN','지점 운영을 위해 고생하시는 모습이 정말 멋져요. 당신의 리더십이 지점의 발전을 이끌고 있어요.',NULL,NULL,NULL,NULL),(15,'ENCOURAGEMENT','BRANCH_SUPER_ADMIN','복잡한 지점 관리 업무를 해결하시는 모습이 정말 대단해요. 당신의 판단력이 팀의 성공을 만들어가고 있어요.',NULL,NULL,'STRESSED',NULL),(16,'SUPPORT','BRANCH_SUPER_ADMIN','지점 수퍼어드민님 덕분에 지점이 안정적으로 운영되고 있어요. 당신의 헌신이 지점의 미래를 밝게 해요.',NULL,NULL,'TIRED',NULL),(17,'APPRECIATION','CLIENT','오늘도 마음을 열고 상담에 참여해주셔서 감사해요. 당신의 용기가 정말 대단해요.',NULL,NULL,NULL,NULL),(18,'ENCOURAGEMENT','CLIENT','힘든 마음을 털어놓아주셔서 고맙습니다. 당신의 솔직함이 치유의 첫걸음이에요.',NULL,NULL,'STRESSED',NULL),(19,'SUPPORT','CLIENT','상담을 받으시느라 고생하셨어요. 당신의 노력이 분명 좋은 결과로 이어질 거예요.',NULL,NULL,'TIRED',NULL),(20,'ENCOURAGEMENT','CLIENT','마음의 변화를 위해 노력하는 당신의 모습이 정말 아름다워요. 당신은 충분히 소중한 사람입니다.',NULL,NULL,'OVERWHELMED',NULL),(21,'APPRECIATION','CLIENT','상담을 통해 조금씩 나아가고 있는 당신이 자랑스러워요. 작은 변화도 큰 의미가 있어요.',NULL,NULL,'SUCCESS',NULL),(22,'SUPPORT','CLIENT','힘든 순간에도 포기하지 않는 당신의 의지력이 정말 대단해요. 당신은 강한 사람이에요.',NULL,NULL,'STRESSED',NULL),(23,'ENCOURAGEMENT','CLIENT','자신을 돌아보고 변화하려는 마음이 정말 고귀해요. 당신의 진심이 느껴져요.',NULL,NULL,'TIRED',NULL),(24,'APPRECIATION','CLIENT','마음의 상처를 치유하려는 용기가 정말 멋져요. 당신의 용기가 많은 사람들에게 힘이 될 거예요.',NULL,NULL,'OVERWHELMED',NULL),(25,'SUPPORT','CLIENT','오늘도 마음을 열어주셔서 고맙습니다. 당신의 신뢰가 상담을 더 의미 있게 만들어요.',NULL,NULL,NULL,NULL),(26,'ENCOURAGEMENT','CLIENT','자신을 돌아보고 성장하려는 마음이 정말 아름다워요. 당신은 이미 훌륭한 사람입니다.',NULL,NULL,'SUCCESS',NULL),(27,'APPRECIATION','CONSULTANT','오늘도 힘든 마음들을 들어주느라 고생하셨어요. 당신의 따뜻한 마음이 많은 사람들에게 힘이 되고 있어요.','2025-09-14 21:55:17.000000',_binary '',NULL,'2025-09-14 21:55:17.000000'),(28,'ENCOURAGEMENT','CONSULTANT','상담사님의 작은 한마디가 누군가에게는 큰 위로가 됩니다. 오늘도 소중한 일을 하고 계세요.','2025-09-14 21:55:17.000000',_binary '',NULL,'2025-09-14 21:55:17.000000'),(29,'SUPPORT','CONSULTANT','힘든 상담이 있어도 포기하지 않는 당신의 모습이 정말 아름다워요. 당신은 훌륭한 상담사입니다.','2025-09-14 21:55:17.000000',_binary '','STRESSED','2025-09-14 21:55:17.000000'),(30,'APPRECIATION','CONSULTANT','오늘 하루도 열심히 일한 당신에게 박수를 보냅니다. 당신의 노력이 세상을 더 따뜻하게 만들어요.','2025-09-14 21:55:17.000000',_binary '','TIRED','2025-09-14 21:55:17.000000'),(31,'SUPPORT','CONSULTANT','상담사님 덕분에 많은 사람들이 희망을 찾고 있어요. 당신은 정말 소중한 존재입니다.','2025-09-14 21:55:17.000000',_binary '','OVERWHELMED','2025-09-14 21:55:17.000000'),(32,'APPRECIATION','CONSULTANT','오늘도 따뜻한 마음으로 내담자들을 도와주셔서 감사해요. 당신의 선한 마음이 세상을 밝게 해요.','2025-09-14 21:55:17.000000',_binary '','SUCCESS','2025-09-14 21:55:17.000000'),(33,'ENCOURAGEMENT','CONSULTANT','힘든 하루였을 수도 있지만, 당신이 한 번의 상담으로도 누군가의 인생을 바꿀 수 있어요.','2025-09-14 21:55:17.000000',_binary '','STRESSED','2025-09-14 21:55:17.000000'),(34,'SUPPORT',