INSERT INTO `wellness_templates` VALUES (1,'MENTAL','\"<h3>🍂 가을 날씨의 변화와 함께 마음챙김하기</h3><p>가을은 서늘한 바람이 불고 나뭇잎이 떨어지는 아름다운 계절입니다...</p><ul><li>매일 아침 일어나면 자신에게 \'좋은 아침\'이라고 말해보세요. 자신에게 긍정적인 에너지를 전해줄 수 있습니다.</li><li>하루에 한 가지 감사할 점을 적어보세요. 작은 것이라도 찾아보면 더 행복해질 수 있습니다.</li><li>가을 햇살을 즐기며 짧은 산책을 해보세요. 자연과 함께하는 시간은 마음을 정화시켜줍니다.</li></ul><p>가을은 변화의 계절이지만 변화는 새로운 가능성을 열어줍니다. 자신을 위한 소중한 시간을 가져보며, 이번 가을을 더욱 뜻깊게 보내보세요. 당신은 중요하고 소중한 존재입니다. 🍁</p>','2025-10-21 14:57:34.332944','AI',2,_binary '',_binary '\0','2025-10-21 15:30:29.767592','FALL','\"가을 날씨에 어울리는 마음챙김 팁','2025-10-21 15:30:29.767965',7),(2,'GENERAL','\"<h3>🍂 가을은 변화의 계절 🍁</h3><p>가을이 찾아왔어요. 시원한 바람이 부는 가을에는...</p><ul><li>매일 조금씩 산책을 즐겨보세요. 자연 속에서 마음을 가다듬을 수 있어요.</li><li>가을 햇살을 받으며 차 한 잔 하면서 마음 가다듬기 시간을 가져보세요.</li><li>가을이지만 물 충분히 섭취하기를 잊지 마세요. 몸과 마음 모두 건강한 상태를 유지해줄 거예요.</li></ul><p>가을은 변화와 성장의 계절입니다. 자연의 변화를 느끼며 나 자신도 조금씩 성장해보는 건 어떨까요? 당신은 할 수 있어요. 함께 걸어가요!</p>','2025-10-22 09:32:23.991522','SYSTEM',3,_binary '',_binary '\0','2025-11-05 09:00:00.164960','FALL','\"가을 날씨에 어울리는 마음챙김 팁','2025-11-05 09:00:00.173707',2),(3,'GENERAL','\"<h3>안녕하세요, 즐거운 수요일!</h3><p>가을 날씨가 서서히 쌀쌀해지고 있네요. 이 가을, 마음챙김에 도움이 될 몇 가지 팁을 소개해드릴게요.</p><ul><li>🍁 가을 햇살을 즐기며 짧은 산책을 해보세요. 자연의 아름다움이 마음을 치유해줄 거예요.</li><li>🍂 따뜻한 차 한 잔과 함께 책을 읽는 시간을 가지세요. 마음의 여유를 챙길 수 있답니다.</li><li>🌰 영양가 풍부한 가을 식재료를 활용한 건강한 식단을 실천해보세요. 몸과 마음에 좋을 거예요.</li><li>🌻 주변 사람들과 소중한 대화를 나누는 시간을 갖는 것도 좋아요. 서로를 위로하고 응원해주는 마음이 소중한 결합이 될 거예요.</li></ul><p>가을은 변화의 계절이자 마음을 다듬는 계절입니다. 올가을, 자신을 사랑하며 건강한 마음을 가꾸는데 실천해봅시다. 힘내세요!</p>','2025-10-29 09:00:04.854648','SYSTEM',3,_binary '',_binary '\0','2025-10-29 09:00:04.852651','FALL','\"가을 날씨에 어울리는 마음챙김 팁','2025-10-29 09:00:04.854668',1),(4,'GENERAL','\"<h3>🍁 가을 바람이 불면서 새로운 시작하기</h3><p>가을이 찾아왔습니다. 시원한 바람이 불면서 새로운 시작을 해보는 건 어떨까요? 이번 주에는 몸과 마음을 챙기며 행복한 변화를 만들어보세요.</p><ul><li>매일 아침 명상을 통해 하루를 시작해보세요. 단 10분만이라도 마음을 가다듬는 시간이 큰 도움이 될 거예요.</li><li>가을 햇살을 즐기며 외출해보세요. 자연 속에서 호흡을 가다듬으면서 신선한 기운을 받을 수 있습니다.</li><li>주말에는 가족이나 친구와 함께하는 시간을 소중히 보내세요. 소소한 특별한 순간을 만들어 나누면 마음이 풍성해집니다.</li></ul><p>작은 변화에서 큰 행복이 시작된다는 걸 잊지 마세요. 자신을 위해 한 발짝씩 나아가는 것만으로도 멋진 변화가 찾아올 거예요. 오늘부터 당신의 건강한 변화의 시작이 되길 응원합니다!</p>','2025-11-07 09:00:06.492047','SYSTEM',5,_binary '',_binary '\0','2025-11-07 09:00:06.490738','FALL','\"가을에 건강한 마음가짐으로 변화를 만들어봐요','2025-11-07 09:00:06.492062',1);
